import { useState } from 'react'
import './Post.css'
function Post({ id, title, body, onClick }) {
    const [isShow, setIsShow] = useState(true)
    // console.log(isShow)
    return (
        <li className="post">
            <span>User id: {id}</span>
            <h2>{title}</h2>
            <p>{body}</p>
            <span>Post id: {id}</span>
            <button className="post-button-delete" onClick={onClick}>
                Delete this is post
            </button>
        </li>
    )
}

export default Post
